	add("doghouse", "{\"term\":\"doghouse\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|dog|house|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any small house or structure or enclosure used to house a dog\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1902\u0027\u0027, Thomas Dixon, \u0027The Leopard\u0027s Spots: A Romance of the White Man\u0027s Burden--1865-1900\u0027, page 6\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;But, honey, whar yo\u0027 ole man gwine ter sleep?\u0026quot; \u0026quot;Dey\u0027s straw in de barn, en pine shatters in de \u0027\u0027doghouse\u0027\u0027!\u0026quot; she shouted, slamming the window\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A structure of small size, similar to a doghouse, but offering useful shelter for a human\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1840\u0027\u0027, James Holman, \u0027Travels in Madeira, Sierra Leone, Teneriffe, St. Jago, Cape Coast, Fernando ..., page 41\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"This berth of mine was commonly called a \u0027\u0027doghouse\u0027\u0027 (a box about six feet long, four high, and two broad,) containing a mattress fitted about 18 inches from the deck\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"p.\u0027 \u0027\u00271927\u0027\u0027, \u0027United States Code Annotated\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"so as to render railroad liable for death of brakeman falling from tender, notwithstanding construction of \u0027\u0027doghouse\u0027\u0027 on top of tender for brakeman\u0027s use\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1958\u0027\u0027, in \u0027Rudder\u0027, Page 3\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The yacht is well equipped and has accommodations for six people. A teak \u0027\u0027doghouse\u0027\u0027 over the forward part of the cockpit affords\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Alan Cockrell, \u0027Drilling Ahead: The Quest for Oil in the Deep South, 1945-2005\u0027, page 27\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A rotary rig could have drilled that much in a day. Oscar had been here a month. He kept a careful log on the \u0027\u0027doghouse\u0027\u0027 wall\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Mechanically, an equipment cover with an opening, with a shape resembling a doghouse\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A difficult or demoralizing situation\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1981\u0027\u0027, Charles Snelling, \u0027Nomenclature of Ships\u0027, Naval Sea Systems Command publicatio\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"During the slave trade, slaves were packed into every available niche aboard the slave ships, including the officers\u0027 cabins. The officers slept on deck in semi-cylindrical boxes, nicknamed \u0026quot;dog houses.\u0026quot; The term \u0026quot;in the in the dog house\u0026quot; grew to describe being in a difficult situation due to the extreme discomfort of sleeping in these boxes\", \"priority\":16}]}, \"synonyms\":{}}");

