	add("dogma", "{\"term\":\"dogma\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027dogma\u0027 (philosophical tenet) from Ancient greek (to 1453) \u0027δόγμα\u0027 (opinion, tenet) from \u0027δοκέω\u0027 (i seem good, think) (more at \u0027\u0027 . Treated in the 17c. -18c. as Greek, with plural \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An authoritative principle, belief or statement of opinion, especially one considered to be absolutely true and indisputable, regardless of evidence or without evidence to support it\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The unforgiving \u0027\u0027dogma\u0027\u0027 of Stalinism is that what the party leader, however cruel and incompetent, decrees, however absurd, must be accepted as law\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A doctrine (or set of doctrines) relating to matters such as morality and faith, set forth authoritatively by a religious organization or leader\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In the Catholic Church, new \u0027\u0027dogmas\u0027\u0027 can only be declared by the pope after the extremely rare procedure \u0027ex cathedra\u0027 to make them part of the official faith\", \"priority\":4}]}, \"synonyms\":{}}");

