	add("dogsbody", "{\"term\":\"dogsbody\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|dog\u0027s|body|lang\u003den}}. 1818, British navy slang, originally derogatory reference to unappetizing {{w|pease pudding}} (compare \u0027dog\u0027s breakfast\u0027 , as if it were made of mashed dog meat. In 20th century applied to low-ranked sailors, thence menial servants in wider usage.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who does menial work, a servant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That\u0027s just Baldrick, my dogsbody.\u0027 \u0026amp;mdash; Blackadder\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Paul Kussmaul, \u0027Training The Translator\u0027, John Benjamins Publishing Co, p. 146\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Furthermore, there are still rather backward opinions in our society about the role of a translator. A translator is often regarded as a linguistic \u0027\u0027dogsbody\", \"priority\":4}]}, \"synonyms\":{}}");

